ERROR - 2024-03-02 17:05:45 --> Query error: Incorrect string value: '\xD0\xB1\xD0\xBB\xD1\x8D...' for column 'located_at' at row 1 - Invalid query: INSERT INTO `center_director` (`center_academy_id`, `name`, `email`, `dob`, `address`, `state`, `country`, `zip`, `special_qualification`, `experience_bharathanatiyam` , `master_name`, `events_performance` , `located_at`, `award_title` , `other_relevant_info`, `ballets_choreographed` , `created_by`, `updated_by`, `created_at`) VALUES (9102, 'Michaeldat', 'pulcfibucyp1977@mail.ru', '1970-01-01', 'Hohenems', 'Austria', 'Austria', '132543', '', '', 'Michaeldat', '', 'блэкспрут сайт', 'блэкспрут сайт', 'Odysseus lunar lander shares new photos from its harrowing descent \r\n<a href=https://blacksprut2rprrt3aoigwh7zftiprzqyqynzz2eiimmwmykw7wkpyad-onion.net>спрут onion </a> \r\nThe Odysseus spacecraft has dispatched new images it captured of the lunar surface during the lander’s harrowing approach to the moon. The vehicle softly touched down on the moon on Thursday, becoming the first US-made lander to do so since the Apollo era. \r\n \r\nThe grainy images were shared by Intuitive Machines, the company that developed Odysseus, on Monday morning. The company had initially projected that the lander could deliver the first images captured from the lunar surface in the hours after landing, but communicating with the spacecraft has proven challenging. \r\nhttps://btrhbfeojofxcpxuwnsp5h7h22htohw4btqegnxatocbkgdlfiawhyid.at \r\nblacksprut2rprrt3aoigwh7zftiprzqyqynzz2eiimmwmykw7wkpyad.onion \r\nThe mission team believes Odysseus tripped on the lunar soil and landed on its side, resting on a rock, which may have left some of the vehicle’s antennas pointed in an inopportune direction, Intuitive Machines revealed Friday. \r\n \r\nIn its update Monday, the company also said it now expects to lose contact with Odysseus on Tuesday — days earlier than initially hoped. \r\n \r\n“Flight controllers intend to collect data until the lander’s solar panels are no longer exposed to light,” the company said in the update posted on the social media platform X. “Based on Earth and Moon positioning, we believe flight controllers will continue to communicate with Odysseus until Tuesday morning.” \r\n \r\nAt that point, Odysseus will have been operating less than five days on the lunar surface. The company had suggested in previous updates that the lander could function for up to nine days.', 'Odysseus lunar lander shares new photos from its harrowing descent \r\n<a href=https://blacksprut2rprrt3aoigwh7zftiprzqyqynzz2eiimmwmykw7wkpyad-onion.net>спрут onion </a> \r\nThe Odysseus spacecraft has dispatched new images it captured of the lunar surface during the lander’s harrowing approach to the moon. The vehicle softly touched down on the moon on Thursday, becoming the first US-made lander to do so since the Apollo era. \r\n \r\nThe grainy images were shared by Intuitive Machines, the company that developed Odysseus, on Monday morning. The company had initially projected that the lander could deliver the first images captured from the lunar surface in the hours after landing, but communicating with the spacecraft has proven challenging. \r\nhttps://btrhbfeojofxcpxuwnsp5h7h22htohw4btqegnxatocbkgdlfiawhyid.at \r\nblacksprut2rprrt3aoigwh7zftiprzqyqynzz2eiimmwmykw7wkpyad.onion \r\nThe mission team believes Odysseus tripped on the lunar soil and landed on its side, resting on a rock, which may have left some of the vehicle’s antennas pointed in an inopportune direction, Intuitive Machines revealed Friday. \r\n \r\nIn its update Monday, the company also said it now expects to lose contact with Odysseus on Tuesday — days earlier than initially hoped. \r\n \r\n“Flight controllers intend to collect data until the lander’s solar panels are no longer exposed to light,” the company said in the update posted on the social media platform X. “Based on Earth and Moon positioning, we believe flight controllers will continue to communicate with Odysseus until Tuesday morning.” \r\n \r\nAt that point, Odysseus will have been operating less than five days on the lunar surface. The company had suggested in previous updates that the lander could function for up to nine days.', 'User', 'User', '2024-03-02 17:05:45')
